void extractTextWithBounds() {
  group('Text Extraction with bounds', () {
    test('barcode.pdf', () {
      final PdfDocument document = PdfDocument.fromBase64String(barcodePdf);
      PdfTextExtractor textExtractor = PdfTextExtractor(document);
      final List<TextLine> textLine = textExtractor.extractTextLines();
      textExtractor = PdfTextExtractor(PdfDocument());
      expect(textLine.isNotEmpty, true,
          reason: 'Failed to extract text lines from barcode.pdf');
    });
    test('barcode.pdf - startPageIndex', () {
      final PdfDocument document = PdfDocument.fromBase64String(barcodePdf);
      final PdfTextExtractor textExtractor = PdfTextExtractor(document);
      List<TextLine> textLine =
          textExtractor.extractTextLines(startPageIndex: 0);
      expect(textLine.isNotEmpty, true,
          reason: 'Failed to extract barcode.pdf text line');
      textLine = textExtractor.extractTextLines(startPageIndex: 1);
      expect(textLine.isNotEmpty, true,
          reason: 'Failed to extract barcode.pdf text line');
      try {
        textLine = textExtractor.extractTextLines(startPageIndex: 2);
      } catch (e) {
        expect(e is ArgumentError, true);
        final ArgumentError error = e as ArgumentError;
        expect(error.message, 'Index out of range');
      }
      try {
        textLine = textExtractor.extractTextLines(startPageIndex: -1);
      } catch (e) {
        expect(e is ArgumentError, true);
        final ArgumentError error = e as ArgumentError;
        expect(error.message, 'Index out of range');
      }
    });
    test('barcode.pdf - endPageIndex', () {
      final PdfDocument document = PdfDocument.fromBase64String(barcodePdf);
      final PdfTextExtractor textExtractor = PdfTextExtractor(document);
      List<TextLine> textLine =
          textExtractor.extractTextLines(startPageIndex: 0, endPageIndex: 1);
      expect(textLine.isNotEmpty, true,
          reason: 'Failed to extract barcode.pdf text line');
      textLine =
          textExtractor.extractTextLines(startPageIndex: 0, endPageIndex: 0);
      expect(textLine.isNotEmpty, true,
          reason: 'Failed to extract barcode.pdf text line');
      textLine =
          textExtractor.extractTextLines(startPageIndex: 1, endPageIndex: 1);
      expect(textLine.isNotEmpty, true,
          reason: 'Failed to extract barcode.pdf text line');
      try {
        textLine = textExtractor.extractTextLines(endPageIndex: 1);
      } catch (e) {
        expect(e is ArgumentError, true);
        final ArgumentError error = e as ArgumentError;
        expect(
            error.message, 'Invalid argument. start page index cannot be null');
      }
      try {
        textLine = textExtractor.extractTextLines(endPageIndex: 2);
      } catch (e) {
        expect(e is ArgumentError, true);
        final ArgumentError error = e as ArgumentError;
        expect(
            error.message, 'Invalid argument. start page index cannot be null');
      }
    });
