String _getJsonStringFromTextLineResult(List<TextLine> textLine) {
  String textLineJsonString = '{"TextLine":[';
  int count = 1;
  // ignore: avoid_function_literals_in_foreach_calls
  textLine.forEach((TextLine line) {
    textLineJsonString +=
        '{"text":"${line.text}","fontName":"${line.fontName}","fontSize":"${line.fontSize}","bounds":{"left":"${line.bounds.left}","top":"${line.bounds.top}","right":"${line.bounds.right}","bottom":"${line.bounds.bottom}"},"pageIndex":"${line.pageIndex}","fontStyle":"';
    String styleString = '';
    int i = 1;
    // ignore: avoid_function_literals_in_foreach_calls
    line.fontStyle.forEach((PdfFontStyle style) {
      styleString += style.toString();
      if (i != line.fontStyle.length) {
        styleString += ',';
      }
      i++;
    });
    textLineJsonString += '$styleString","wordCollection":[';
    String wordCollectionString = '';
    int wordCount = 0;
    // ignore: avoid_function_literals_in_foreach_calls
    line.wordCollection.forEach((TextWord word) {
      wordCollectionString +=
          '{"text":"${word.text}","fontName":"${word.fontName}","fontSize":"${word.fontSize}","bounds":{"left":"${word.bounds.left}","top":"${word.bounds.top}","right":"${word.bounds.right}","bottom":"${word.bounds.bottom}"},"fontStyle":"';
      String wordStyleString = '';
      int j = 1;
      // ignore: avoid_function_literals_in_foreach_calls
      word.fontStyle.forEach((PdfFontStyle style) {
        wordStyleString += style.toString();
        if (j != word.fontStyle.length) {
          wordStyleString += ',';
        }
        j++;
      });
      wordCollectionString += '$wordStyleString","glyphs":[';
      String glyphCollectionString = '';
      int glyphCount = 0;
      // ignore: avoid_function_literals_in_foreach_calls
      word.glyphs.forEach((TextGlyph glyph) {
        glyphCollectionString +=
            '{"text":"${glyph.text}","fontName":"${glyph.fontName}","fontSize":"${glyph.fontSize}","bounds":{"left":"${glyph.bounds.left}","top":"${glyph.bounds.top}","right":"${glyph.bounds.right}","bottom":"${glyph.bounds.bottom}"},"fontStyle":"';
        String glyphStyleString = '';
        int z = 1;
        // ignore: avoid_function_literals_in_foreach_calls
        glyph.fontStyle.forEach((PdfFontStyle style) {
          glyphStyleString += style.toString();
          if (z != glyph.fontStyle.length) {
            glyphStyleString += ',';
          }
          z++;
        });
        glyphCollectionString += '$glyphStyleString"}';
        glyphCount++;
        if (glyphCount != word.glyphs.length) {
          glyphCollectionString += ',';
        }
      });
      wordCollectionString += '$glyphCollectionString]}';
      wordCount++;
      if (wordCount != line.wordCollection.length) {
        wordCollectionString += ',';
      }
    });
    textLineJsonString += '$wordCollectionString]}';
    if (count != textLine.length) {
      textLineJsonString += ',';
    }
    count++;
  });
  textLineJsonString += ']}';
  return textLineJsonString;
}

/// helper method to draw rectangle on bounds
void drawRectangleWithTextLine(
    List<TextLine> textLine, PdfDocument document, String fileName) {
  if (textLine.isNotEmpty) {
    int i = 0;
    final List<PdfPen> pens = <PdfPen>[
      PdfPen(PdfColor(250, 0, 0), width: 0.4),
      PdfPen(PdfColor(0, 250, 0), width: 0.4),
      PdfPen(PdfColor(0, 0, 250), width: 0.4),
      PdfPen(PdfColor(200, 0, 200), width: 0.4)
    ];
    // ignore: avoid_function_literals_in_foreach_calls
    textLine.forEach((TextLine line) {
      final int index = line.pageIndex;
      final Rect bounds = line.bounds;
      if (index >= 0 && index < document.pages.count) {
        final PdfPage page = document.pages[index];
        page.graphics.drawRectangle(pen: pens[i % 4], bounds: bounds);
        i++;
      }
    });
    final List<int> bytes = document.saveSync();
    expect(bytes.isNotEmpty, true, reason: 'Failed to extract text lines');
    savePdf(bytes, fileName);
  }
}
